script: |
  super -f text -I q9800.spq | sort > q9800.out

inputs:
  - name: q9800.spq
    data: |
      SELECT ALL ( + COUNT ( * ) ) FROM tab0 (FORMAT parquet) AS cor0 WHERE col1 NOT BETWEEN ( + col0 * - - col0 ) AND ( 62 + + col1 );
  - name: tab0

outputs:
  - name: q9800.out
    data: |
      3
